import React from 'react';
import {Link} from 'react-router-dom';

function Navbar1() {
    return (
        <nav style={{height:"100%", width:"30%"}}>

            <Link to="/"><h1>College Kitchen</h1></Link>

            <Link to="/About">About</Link>

            <Link to="/">Menu</Link>
        </nav>
    );
}

export default Navbar1;
